import React from 'react'
import './phone-buy.css'

export const PhoneBuy = ({phone}) => {
  return (
    <div className='phone-buy'>
        <span className='phone-buy-price'>{ phone.price }$ </span>
        <div className='phone-item-buy'>
          Buy
        </div>
    </div>
  )
}
